import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { Container, Row, Col, Card } from "react-bootstrap";
import MyRecipeService from "../../services/myrecipe.service";
import "../style.css";

const MyRecipeHome = () => {
  return (
    <main>
      <Container fluid>
          <MyRecipe/>
          <LikedRecipe/>
      </Container>
    </main>
  );
};

const Recipe = ({recipe}) => {
  const navigate = useNavigate()
  return(
    <Col>
      <Card>
        <Card.Img variant="top" src="logo192.png" />
        <Card.Body>
          <Card.Title>
            <a href={`/myrecipe/${recipe.id}`}>{recipe.name}</a>
            <button className="btn btn-round" onClick={() => navigate(`/myrecipe/${recipe.id}/edit`)}>
              <i className="bi bi-pencil-fill"></i>
            </button> 
          </Card.Title>
          <Card.Text> {recipe.desc} </Card.Text>
        </Card.Body>
      </Card>
    </Col>
  );
};

const MyRecipe = () => {
  const [recipes, setRecipes] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    MyRecipeService.getAllRecipe()
    .then(({data}) => {
      setRecipes(data);
    })
    .catch((err) => {
      console.log(err)
    });
  }, [])

  return(
    <Container className="py-5" fluid>
      <h3>MY RECIPES
        <button className="btn btn-round" onClick={() => navigate("/myrecipe/newrecipe")}>
          <i className="bi bi-plus-lg"></i>
        </button> 
      </h3>
      <Row xs={1} md={4} className="g-4">
        {recipes.map((recipe, idx) => (
          <Recipe key={idx} recipe={recipe}/>
        ))}
      </Row>
    </Container>
  );
};

const LikedRecipe = () => {
  return(
    <div>
      <h3> Liked Recipes </h3>
    </div>
  );
};

export default MyRecipeHome;
